import React from 'react';
import './App.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Lore from './components/lore/lore'
import Home from './components/home/home'
import Navbar from './components/navbar/navbar';
import Rules from './components/rules/rules';
import Downtime from './components/downtime/downtime';
import General from './components/mechanics/general';
import BookOfPowersAndDieties from './components/mechanics/book-of-powers-and-dieties';
import MasterworkWeapons from './components/mechanics/masterwork';
import Guilds from './components/mechanics/guilds';
import Prestige from './components/mechanics/prestige';


function App() {
  return (    
    <div>
      <Router>
        <Navbar></Navbar>
        <div>
        <Routes>
          <Route path="/" element={<Home/>} />
          <Route path="/home" element = {<Home/>} />
          <Route path="/lore" element={<Lore/>} />
          <Route path="/rules" element={<Rules/>} />
          <Route path="/downtime" element={<Downtime/>}/>
          <Route path="/mechanics/general" element={<General/>}/>
          <Route path='/mechanics/prestige-levels' element={<Prestige/>}/>
          <Route path='/mechanics/masterwork' element={<MasterworkWeapons/>}/>
          <Route path='/mechanics/guilds' element={<Guilds/>}/>
          <Route path='/mechanics/book-of-powers' element={<BookOfPowersAndDieties/>}/>
        </Routes>
        </div>
      </Router>        
    </div>    
  );
}

export default App;
